import {React} from 'react';
export function Logo({teamName}) {

    const path = "/${teamName}.png";

    return (
        <div className="Logo">
            if(teamName==="Mumbai Indians")
            <img src={process.env.PUBLIC_URL + "Mumbai Indians.png"} width="150" alt="MI"/>
        </div>
        );
}
